    % constants
    properties(Constant, Access = 'private')               
        
        % modified julian day reference epoch
        %
        % cross-ref with IERSLib.MJD_REF_EPOCH
        %
        MJD_REF_EPOCH = 2400000.5;
    
    end
    
    % tests
    methods(Access = 'private')                            
        
        function bool = test_getEOP_1(this)                
            
            % set the time to test (UTC)
            t = 53101;
            
            % compute eop info at time t (UTC)
            [xp,yp,du,dt] = this.getEOP(t);
            
            % the values should be
            xp_t = -0.1407150;
            yp_t =  0.3335200;
            du_t = -0.4399519;
            dt_t = 32;
            
            % make sure differences are really small
            bool = ~any(abs([xp,yp,du,dt]-[xp_t,yp_t,du_t,dt_t]) > 1e-12);
        end
    end
    
    % helpers
    methods(Access = 'private') 
        
        function validateTime(this,t)                      
            
            % get the time tags for EOP observations
            eopTime = this.bullA(:,1);
            
            % figure out min and max non nan entries
            minEOPTime = min( eopTime( ~isnan(eopTime) ) );
            maxEOPTime = max( eopTime( ~isnan(eopTime) ) );
            
            % make sure that the requested times are within the min max
            if any(t < minEOPTime)
                error([                                ...
                       'requested time '           ,   ...
                       'is less than min EOP time ',   ...
                       num2str(minEOPTime)             ...
                      ]                                ...
                )
            end
            
            % make sure that the requested times are within the min max
            if any(t > maxEOPTime)
                error([                                ...
                       'requested time '              ,...
                       'is greater than max EOP time ',...
                       num2str(maxEOPTime)             ...
                      ]                                ...
                )
            end
            
        end
        
    end
    
    % parsers
    methods(Static, Access = 'private')                    
        
        function [t,xp,yp,du] = parseFinalsLine (line)     
            
            % 
            % input:
            %
            %   line [1xN] - character string/array (min length 78)
            %
            %
            % output:
            %
            %    t    [1]  - modified julian day referenced to UTC
            %
            %   xp,yp [1]  - polar motion   [arcsec ]
            %
            %    du   [1]  - UTC-UT1 offset [seconds]
            %
            %
            %
            % NOTES:  
            %
            %  for full format description see:
            %
            %    http://maia.usno.navy.mil/ser7/readme.finals
            %
            %
            
            % initialize the output
            t = nan; xp = nan; yp = nan; du = nan;
            
            % make sure the line has minimum number of characters
            if numel(line) < 78; return; end
            
            try
                % parse time
                t  = str2double(line(8:12));

                % parse polar motion xp and yp
                xp = str2double(line(19:27));
                yp = str2double(line(38:46));

                % parse UTC-UT1 offset
                du = str2double(line(59:68));
                
            catch e %#ok<NASGU>
                
                % default values
                t = nan; xp = nan; yp = nan; du = nan; 
                
                % abort
                return;
            end
        end
        
        function [t,xp,yp,du] = parseSer7Line   (line)     
                        
            % 
            % input:
            %
            %   line [1xN] - character string/array
            %
            %
            % output:
            %
            %    t    [1]  - modified julian day referenced to UTC
            %
            %   xp,yp [1]  - polar motion   [arcsec ]
            %
            %    du   [1]  - UTC-UT1 offset [seconds]
            %
            %
            %
            % NOTES:  
            %
            %  for full format see:
            %
            %    http://maia.usno.navy.mil/ser7/ser7.dat
            %
            %
            
            % initialize the output
            t = nan; xp = nan; yp = nan; du = nan;
            
            % break the line into parts using white space as delimiter
            lineParts = regexp(strtrim(line),'\s+','split');
            
            % parse the line entries
            try
                if numel(lineParts) == 10
                    t  = str2double(lineParts{4});
                    xp = str2double(lineParts{5});
                    yp = str2double(lineParts{7});
                    du = str2double(lineParts{9});
                elseif numel(lineParts) == 7
                    t  = str2double(lineParts{4});
                    xp = str2double(lineParts{5});
                    yp = str2double(lineParts{6});
                    du = str2double(lineParts{7});
                else               
                    return;
                end
                
            catch e %#ok<NASGU>
                
                % restore default values
                t = nan; xp = nan; yp = nan; du = nan;

                % abort
                return;
            end

        end
        
        function [t,dt,j1,j2] = parseLeapSecLine(line)     
            
            % 
            % input:
            %
            %   line [1xN] - character string/array
            %
            %
            % output:
            %
            %    t    [1]  - julian day referenced to UTC
            %
            %    dt   [1]  - TAI-UTC offset [seconds]
            %
            %   j1,j2 [1]  - nan (junk)
            %
            %
            % NOTES:  
            %
            %  for full file see:
            %
            %    http://maia.usno.navy.mil/ser7/tai-utc.dat
            %
            %
            
            % initialize the output
            t = nan; dt = nan; j1 = inf; j2 = inf;
            
            % break the line into parts using white spaces as delimiter
            lineParts = regexp(strtrim(line),'\s+','split');
            
            % make sure line has appropriate number of entries
            if numel(lineParts) ~= 15; return; end;
            
            % parse julian day
            t  = str2double(lineParts{5});
            
            % parse offset
            dt = str2double(lineParts{7});
            
        end
              
        function data = parseFile(filePath  ,lineParseFunc)
            
            % first make sure the file actually exists
            if ~exist(filePath,'file')
                error(['file: ',filePath,' does not exist']);
            end
            
            % open the file for reading
            fid = fopen(filePath);
            
            % make sure the file open was ok
            if fid == -1
                error(['error opening file ', filePath]);
            end
            
            % init eop storage
            data = nan(25000,4); 
            
            % init index into eop
            indx = 1;
            
            % loop over the lines until we run out of them
            while true

                % get line of text from the file
                line = fgetl(fid);

                % see if we're at the end of the file
                if ~ischar(line); break; end
                
                % parse the line
                [o1,o2,o3,o4] = lineParseFunc(line);
                
                % if the data is no bueno then move along
                if any(isnan([o1,o2,o3,o4])); continue; end
                
                % set the eop data
                data(indx,:) = [o1,o2,o3,o4];
                
                % update index
                indx = indx + 1;
            end
            
            % clean up - remove empty entires
            if indx < size(data,1); data(indx:end,:) = []; end
        end 
        
        function data = parseData(dataMatrix,lineParseFunc)
           
            % compute the number of data lines/rows to parse
            numLines = size(dataMatrix,1);
            
            % initialize the data
            data = nan(numLines,4);
            
            % init data index
            indx = 1;
            
            % parse each row (line of data)
            for i = 1:numLines
                
                % parse the line of data
                [o1, o2, o3, o4] = lineParseFunc(dataMatrix(i,:));
                
                % if the data is no bueno then move along
                if any(isnan([o1,o2,o3,o4])); continue; end
                
                % set the eop data
                data(indx,:) = [o1,o2,o3,o4];
                
                % update index
                indx = indx + 1;
            end
            
        end
        
        function data = urlRunner(url,N)                   
            
            % do it
            try
                % snag the data from a series of "tubes"
                data = urlread(url);
            catch e
                
                % nothing we can do about it here
                rethrow(e);
            end
            
            % if there is no N specified then we're done
            if nargin == 1; return; end;
            
            % reshape the data into multiple lines
            if N > 1
                data = reshape(data',N,numel(data)/N)';
            end
        end
    end
    
    % file parsers
    methods(Access = 'public')                             
       
        function this = initWithFinalsFile(this,filePath)  
            this.bullA   = this.parseFile(filePath,@EOPLib.parseFinalsLine );
        end
        
        function this = initWithSer7File(this,filePath)    
            this.bullA   = this.parseFile(filePath,@EOPLib.parseSer7Line   );
        end
        
        function this = initWithLeapSecFile(this,filePath) 
            this.tai_utc = this.parseFile(filePath,@EOPLib.parseLeapSecLine);
        end
        
    end    
    
    % http data parsers
    methods(Access = 'public')                             
        
        function this = initWithFinalsHttp (this,kind)     
                        
            %
            %  initialize object with EOP data from
            %
            %    http://maia.usno.navy.mil/ser7/finals2000A.all
            %
            %    or
            %
            %    http://maia.usno.navy.mil/ser7/finals.daily
            %
            %
            
            % \n converted to \s
            lineSize = 187+1;
            
            % specify where to get the data
            if nargin == 2 && strcmpi(kind,'daily')
                url = 'http://maia.usno.navy.mil/ser7/finals.daily';
            else
                url = 'http://maia.usno.navy.mil/ser7/finals2000A.all';
            end
            
            % get the data
            data = EOPLib.urlRunner(url,lineSize);
            
            % parse the data
            data = EOPLib.parseData(data,@EOPLib.parseFinalsLine);
            
            % clean up - remove rows of nans 
            nanIndx = isnan(data(:,1)); data(nanIndx,:) = [];
            
            % that's all 
            this.bullA = data;
        end
        
        function this = initWithSer7Http   (this)          

            % 
            % initialize EOP data using ser7 located at
            %
            %    http://maia.usno.navy.mil/ser7/ser7.dat
            %
            
            % really it's char(10) for newline character
            nl = sprintf('\n'); ws = ' ';
            
            % specify where to get the data
            url = 'http://maia.usno.navy.mil/ser7/ser7.dat';
            
            % do it
            try
                % snag the data from a series of "tubes"
                data = urlread(url);
            catch e
                
                % nothing we can do about it here
                rethrow(e);
            end
            
            % figure out where the new lines are 
            nlIndx = [0, cumsum(diff(strfind(data,nl)))];
            
            % initialize data80
            data80 = nan(1000,80);
            
            % go through the new line indexes
            for i = 1:numel(nlIndx)-1
                
                % compute start and stop index for new line
                startIndx = nlIndx(i)+1;
                stopIndx  = nlIndx(i+1);
                
                % extract the data
                d = data(startIndx:stopIndx);
                                
                % figure out how many white spaces need to add
                if numel(d) < 80
                    nWS  = 80 - numel(d);
                    data80(i,:) = [d,repmat(ws,1,nWS)];
                else
                    data80(i,:) = d(1:80);
                end
                
            end
            
            % parse the data
            data = EOPLib.parseData(char(data80),@EOPLib.parseSer7Line);
            
            % clean up
            nanIndx = isnan(data(:,1)); data(nanIndx,:) = [];
            
            % and we're done
            this.bullA = data;
            
        end
        
        function this = initWithLeapSecHttp(this)          
            
            lineSize = 80+1;
            
            % where oh where does the data come from
            url = 'http://maia.usno.navy.mil/ser7/leapsec.dat';
            
            % get the data
            data = EOPLib.urlRunner(url,lineSize);
            
            % do the deed
            data = EOPLib.parseData(data,@EOPLib.parseLeapSecLine);
            
            % no nan left behind
            nanIndx = isnan(data(:,1)); data(nanIndx,:) = [];
            
            % that's a [w]rap
            this.tai_utc = data;
        end
        
    end
    
    % accessors
    methods(Access = 'public')                             
        
        function x  = xp  (this,t)                         
            x = interp1(this.bullA(:,1),this.bullA(:,2),t(:),'linear');
        end
        
        function y  = yp  (this,t)                         
            y = interp1(this.bullA(:,1),this.bullA(:,3),t(:),'linear');
        end
        
        function du = dut1(this,t)
            
            % NOTE: t is the time to interpolate to
            
            % initialize leap second vector
            l = zeros(size(this.bullA,1),1);
            
            % add a 1 at each day there is a leap second
            for i = 1:size(this.tai_utc,1)
                
                % figure out where the leap seconds are in bullA data
                indx = this.bullA(:,1) ...
                        == this.tai_utc(i,1)-IERSLib.MJD_REF_EPOCH;
                
                % make a note
                l(indx) = 1;
            end
            
            % the cumulative total offset at each time
            lc = cumsum(l);
            
            % interpolate the UT1-UTC without leapseconds (continuous)
            du = interp1(                      ...
                    this.bullA(:,1),           ...
                    this.bullA(:,4)-cumsum(l), ...
                    t(:),                      ...
                    'linear'                   ...
            );
        
            % OK, now add the leap seconds back in (discontinuous)
            %  Need to look through t rather than bullA(:,1)
            for i = 1:numel(t)
                indx = this.bullA(:,1) == floor(t(i));
                du(i) = du(i) + lc(indx);
            end
            
        end
        
        function dt = dtai(this,t)                         
            
            % get the tai offsets
            offsets = this.tai_utc(:,2);
            
            % figure out dt value for extrapolation [defensive]
            extrapValue = max(offsets(~isnan(offsets)));
            
            dt = interp1(                                          ...
                         this.tai_utc(:,1) - EOPLib.MJD_REF_EPOCH, ...
                         this.tai_utc(:,2),                        ...
                         t(:),                                     ...
                         'linear',                                 ...
                         extrapValue                               ...
            );
                     
            dt = floor(dt);
        end
        
        function [xp, yp, du, dt] = getEOP(this,t)         
            
            % 
            % input:
            %
            %   t [Nx1] - time in MJD referenced to UTC
            %
            %
            % output: 
            %
            %   xp,yp   [Nx1] - PM-x and PM-y  [arcsec ]
            %
            %   du      [Nx1] - UTC-UT1 offset [seconds]
            %
            %   dt      [Nx1] - UTC-TAI offset [seconds]
            %
            %
            
            % fail fast, check time with in EOP data
            this.validateTime(t);
            
            % compute polar motion
            xp = this.xp(t); yp = this.yp(t);
            
            % compute offset between UTC and UT1
            du = this.dut1(t);
            
            % compute offset between UTC and TAI
            dt = this.dtai(t);
            
        end
        
        function bool = test(this)                         
            bool = [                      ...
                     this.test_getEOP_1() ...
            ]; %#ok<NBRAK>
                   
        end
    end
    
